import Layout from "../components/Layout";
import Project from "../components/Project";

function Work() {
  return (
    <Layout>
      <h1>Check out my work</h1>
      <div className="wrapper">
        <Project />
      </div>
      <style jsx>
        {`
          .wrapper {
            display: grid;
            grid-template-column: repeat(auto-fill, minmax(25%, 1fr));
          }
        `}
      </style>
    </Layout>
  );
}

export default Work;
